import React, { Component } from 'react';

class List extends Component {

  render() {
    return (
      <div id="list-container">
        {
          this.props.borough_filter.map(l => {
            <h1>{l.FacilityName}</h1>

          })
        }
      </div>
    );
  }

}

export default List;
